import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Button, TextField, Grid, Card, CardContent, Box } from '@material-ui/core';
import openSocket from 'socket.io-client';

const socket = openSocket('http://localhost:5000');

const useStyles = makeStyles((theme) => ({
	root: {
		padding: theme.spacing(1),
	},
}));

function App() {
	const classes = useStyles();

	return (
		<Box component='div' display='inline'>
			<form noValidate autoComplete="off">
				<TextField id="name" label="Name" variant="outlined"/>
				<Button type='submit' variant='contained' color='primary'>Start Game</Button>
			</form>

			<form noValidate autoComplete="off">
				<TextField id="gameCode" label="Game Code" variant="outlined"/>
				<Button type='submit' variant='contained' color='primary'>Join Game</Button>
			</form>
		</Box>
	);
}

export default App;
